import React from "react";

function Buttons(props) {
  return (
    <div className="buttons-container">
      <button
        onClick={() => {
          props.bubbleSort();
        }}
        type="button"
        class="btn btn-light"
      >
        Bubble Sort
      </button>
      <button
        onClick={() => {
          props.insertionSort(props.arr);
        }}
        type="button"
        class="btn btn-light"
      >
        Insertion Sort
      </button>
      <button
        onClick={() => {
          props.quickSort(props.arr)
        }}
        type="button"
        class="btn btn-light"
      >
        Quick Sort
      </button>
      <button
        onClick={() => {
          props.mergeSort()
        }}
        type="button"
        class="btn btn-light"
      >
        Merge Sort
      </button>
    </div>
  );
}

export default Buttons;
